import React from 'react'
import './App.css';
import { Route } from "wouter"
import Home from "./pages/Home"
import Films from './pages/Films';

export default function App() {

  return <>
      <Route
          component={Home}
          path="/"
      />  

      <Route
          component={Films}
          path="/films"
      />

      <Route
        component={SearchResults}
        path="/search/:keyword" 
      />
      <Route
        component={Detail}
        path="/gif/:id"
        />
  </>
}
